column509:
02.02.2024 17:34;U_0227P;[~U_M1SK9] после митинга с паспортом выяснили, что ошибка такого вида возвращается, когда заблокирована кроссавторизация между конкретными приложениями. То есть в запрос:
{code:java}
curl --location -g --request GET 'https://alfa-mobile.alfabank.ru/ALFAJMB/openid/crossauth?refresh_token={refreshToken}&client_id=adirect-web&scope=adirect-web'
{code}
кто-то отправляет refresh_token от клиента, которому не разрешена кроссавторизация в adirect-web. Для локализации проблемы, необходимо отловить этот refresh_token и узнать через поддержку паспорта, какому клиентскому приложению принадлежит этот refresh_token. Далее сделать выводы:

разрешить кроссавторизацию через заявки в сопровождение паспорта или не разрешать. Мы скоро зарелизим задачу с логированием и сможем отловить refresh_token.

column512:
21.02.2024 11:43;U_0227P;Не сходится реальность с тем, что говорили ребята из паспорта. По их словам, такая ошибка возникает в случаях, когда происходит кроссавторизация между client_id, у которых не налажено доверие.
Эта ошибка возникает из ПВА trade.alfadirect.ru (client_id=adirect-app), и происходит кроссавторизация в adirect-web, но из adirect-app в adirect-web разрешена кроссавторизация.

У меня есть подозрение, что это какая-то бага джимбы, через которую работает кроссавторизация, нужно подключать ребят из паспорта, не знаю, куда дальше копать по этой проблеме.

 
