 Request true GET https://lk.alfadirect.ru/api/passport/crossauthbyrefresh?refresh_token=a2d88f4f-ed37-365f-ba94-a335b30721d7&redirect_uri=https:%2F%2Ftrade.alfadirect.ru%2F&crossauth_client_id=adirect-web; Elapsed: 54; StatusCode: 403; RequestBody: ; ResponseBody: {"id":"FORBIDDEN_CROSS_AUTH_TO_SESSION","message":{"en":"Forbidden crossauth to session"},"base_id":"16080bf6-dbe4-428e-b648-06739b59e920","type_id":"AUTHORIZATION","class":"class ru.ratauth.exception.AuthorizationException"}; RequestHeaders: Connection: close; Accept: */*; Accept-Encoding: gzip,deflate,br; Accept-Language: ru-RU,ru; q=0.8,en-US; q=0.5,en; q=0.3; Host: lk.alfadirect.ru; Referer: https://trade.alfadirect.ru/; User-Agent: Mozilla/5.0,(X11; Linux x86_64; rv:109.0),Gecko/20100101,Firefox/113.0; X-Real-IP: 172.21.18.102; X-Forwarded-For: 172.21.18.102; X-Forwarded-Proto: https; Origin: https://trade.alfadirect.ru; Sec-Fetch-Dest: empty; Sec-Fetch-Mode: cors; Sec-Fetch-Site: same-site; ResponseHeaders: X-ORACLE-DMS-ECID: 76a5bd67a658c554:7fd6fa50:18da363e430:-8000-00000000022c128e; Transfer-Encoding: chunked; Date: Tue, 20 Feb 2024 17:02:27 GMT; Set-Cookie: JSESSIONID=uGPHeAPMtvSWqcwg8ge2NjaxWUBSXh3c4EU7UbLytq7t0LnZTejf!-1711520424!-399539278; path=/; HttpOnly; Access-Control-Allow-Origin: https://trade.alfadirect.ru; Access-Control-Allow-Credentials: true; Content-Type: application/json; ContentType: application/jsonTreaty: null; WrongApiUrl: false; RouteTemplate: api/passport/crossauthbyrefresh
